function Section2(){

    return(
        <div id='Section2'>
            <div className='vidContainer'>
                <video src="Video/Yacht.mp4" autoPlay={true} loop={true} controls={false} playsInline muted></video>
            </div>
        </div>
    )
}

export default Section2;
